            margin-top: 20px;
        }

            background-color: #808080;

            color: #333;
        }

        #totalData {
            text-align: center;
            margin-top: 10px;

        }

        table {

            border-collapse: collapse;
            margin-top: 20px;

        }

        thead, tbody { display:block; }

        tbody {
            height: 350px;
            width: 550px;
            overflow-y: auto;
            overflow-x: hidden;
            align-self: center;
        }

        th, td {

            text-align: center;
        }

        th {
            width: 300px;
            background-color: #808080;
            color: white;
        }

        /* width */

        }

        /* Track */

        }

        ::-webkit-scrollbar-thumb {
        background: #888;
        }

        /* Handle on hover */
        ::-webkit-scrollbar-thumb:hover {
        background: #555;
        }
    </style>

        let n = 0;

        function displayData(data) {
            const tbody = document.querySelector('#dataTable tbody');
            tbody.innerHTML = '';
            data.forEach(item => {
                const row = document.createElement('tr');
                row.innerHTML = `
                    <td>${item.nama_custumer}</td>
                    <td>${item.skala_prioritas}</td>
                `;
                tbody.appendChild(row);
            });
            document.getElementById('textinput').textContent = `Masukan banyak data yang diproses (n)`;
            // Update total data count
            document.getElementById('totalData').textContent = `Total Data: ${data.length}`;
        }

        function insertionSortIterative(data, n) {
            for (let i = 1; i < n; i++) {
                let temp = data[i];
                let j = i - 1;

                while (j >= 0 && data[j].skala_prioritas > temp.skala_prioritas) {
                    data[j + 1] = data[j];
                    j--;
                }

                data[j + 1] = temp;
            }
        }

        function insertSorted(dataLaundry, n) {
            const temp = dataLaundry[n];
            let j = n - 1;

            while (j >= 0 && dataLaundry[j].skala_prioritas > temp.skala_prioritas) {
                dataLaundry[j + 1] = dataLaundry[j];
                j--;
            }
            dataLaundry[j + 1] = temp;
        }

        function insertionSortRecursive(dataLaundry, n) {
            if (n <= 1) {
                return;
            }

            insertionSortRecursive(dataLaundry, n - 1);
            insertSorted(dataLaundry, n - 1);
        }

        function sortData(method) {

            if (n === 0){
                n = dataLaundry.length;
            }
            let startTime;
            let endTime;

            if (method === 'iterative') {
                startTime = performance.now();
                insertionSortIterative(dataLaundry, n);
                endTime = performance.now();
            } else if (method === 'recursive') {
                startTime = performance.now();
                insertionSortRecursive(dataLaundry, n);
                endTime = performance.now();
            }

            const executionTimeSeconds = ((endTime - startTime) / 1000).toFixed(4);

            displayData(dataLaundry);

            document.getElementById('executionTime').textContent = 
                `Sorting completed in ${executionTimeSeconds} seconds using ${method} method.`;
        }

        function setN() {
            const inputN = document.getElementById('input').value;
            n = parseInt(inputN, 10) || dataLaundry.length;
            alert(`Value of n set to ${n}`);
        }

        // Initial display
        displayData(dataLaundry);
